        B1_0(:,(j-1)*100+1) = Ret_TopThree(T01 * [B1_1(:,(j-1)*100+1);1]);
        B2_0(:,(j-1)*100+1) = Ret_TopThree(T01 * [B2_1(:,(j-1)*100+1);1]);
        B3_0(:,(j-1)*100+1) = Ret_TopThree(T01 * [B3_1(:,(j-1)*100+1);1]);


        C1_1(:,(j-1)*100+1) = Ret_TopThree(T12 * [C1_2(:,(j-1)*100+1);1]);
        C2_1(:,(j-1)*100+1) = Ret_TopThree(T12 * [C2_2(:,(j-1)*100+1);1]);
        C3_1(:,(j-1)*100+1) = Ret_TopThree(T12 * [C3_2(:,(j-1)*100+1);1]);

        C1_0(:,(j-1)*100+1) = Ret_TopThree(T01 * [C1_1(:,(j-1)*100+1);1]);
        C2_0(:,(j-1)*100+1) = Ret_TopThree(T01 * [C2_1(:,(j-1)*100+1);1]);
        C3_0(:,(j-1)*100+1) = Ret_TopThree(T01 * [C3_1(:,(j-1)*100+1);1]); 


        D1_2(:,(j-1)*100+1) = Ret_TopThree(T23 * [D1_3(:,(j-1)*100+1);1]);
        D2_2(:,(j-1)*100+1) = Ret_TopThree(T23 * [D2_3(:,(j-1)*100+1);1]);
        D3_2(:,(j-1)*100+1) = Ret_TopThree(T23 * [D3_3(:,(j-1)*100+1);1]);

        D1_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * [D1_2(:,(j-1)*100+1);1]);
        D2_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * [D2_2(:,(j-1)*100+1);1]);
        D3_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * [D3_2(:,(j-1)*100+1);1]);


        E1_3(:,(j-1)*100+1) = Ret_TopThree(T34 * [E1_4(:,(j-1)*100+1);1]);
        E2_3(:,(j-1)*100+1) = Ret_TopThree(T34 * [E2_4(:,(j-1)*100+1);1]);
        E3_3(:,(j-1)*100+1) = Ret_TopThree(T34 * [E3_4(:,(j-1)*100+1);1]);

        E1_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * [E1_3(:,(j-1)*100+1);1]);
        E2_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * [E2_3(:,(j-1)*100+1);1]);
        E3_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * [E3_3(:,(j-1)*100+1);1]);


        F1_4(:,(j-1)*100+1) = Ret_TopThree(T45 * [F1_5(:,(j-1)*100+1);1]);
        F2_4(:,(j-1)*100+1) = Ret_TopThree(T45 * [F2_5(:,(j-1)*100+1);1]);
        F3_4(:,(j-1)*100+1) = Ret_TopThree(T45 * [F3_5(:,(j-1)*100+1);1]);

        F1_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * T34 * [F1_4(:,(j-1)*100+1);1]);
        F2_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * T34 * [F2_4(:,(j-1)*100+1);1]);
        F3_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * T34 * [F3_4(:,(j-1)*100+1);1]);


        G1_5(:,(j-1)*100+1) = Ret_TopThree(T56 * [G1_6(:,(j-1)*100+1);1]);
        G2_5(:,(j-1)*100+1) = Ret_TopThree(T56 * [G2_6(:,(j-1)*100+1);1]);
        G3_5(:,(j-1)*100+1) = Ret_TopThree(T56 * [G3_6(:,(j-1)*100+1);1]);

        G1_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * T34 * T45 * [G1_5(:,(j-1)*100+1);1]);
        G2_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * T34 * T45 * [G2_5(:,(j-1)*100+1);1]);
        G3_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * T34 * T45 * [G3_5(:,(j-1)*100+1);1]); 

        H0_0(:,(j-1)*100+1) = Ret_TopThree(T01 * T12 * T23 * T34 * T45 * T56 * [H0_6(:,(j-1)*100+1);1]);


        % 底层中心点
        A0_0(1,(j-1)*100+1) = (A1_0(1,(j-1)*100+1)+A2_0(1,(j-1)*100+1)+A3_0(1,(j-1)*100+1))/3;
        A0_0(2,(j-1)*100+1) = (A1_0(2,(j-1)*100+1)+A2_0(2,(j-1)*100+1)+A3_0(2,(j-1)*100+1))/3;
        A0_0(3,(j-1)*100+1) = (A1_0(3,(j-1)*100+1)+A2_0(3,(j-1)*100+1)+A3_0(3,(j-1)*100+1))/3;
        % 第一层中心点
        B0_0(1,(j-1)*100+1) = (B1_0(1,(j-1)*100+1)+B2_0(1,(j-1)*100+1)+B3_0(1,(j-1)*100+1))/3;
        B0_0(2,(j-1)*100+1) = (B1_0(2,(j-1)*100+1)+B2_0(2,(j-1)*100+1)+B3_0(2,(j-1)*100+1))/3;
        B0_0(3,(j-1)*100+1) = (B1_0(3,(j-1)*100+1)+B2_0(3,(j-1)*100+1)+B3_0(3,(j-1)*100+1))/3;
        % 第二层中心点
        C0_0(1,(j-1)*100+1) = (C1_0(1,(j-1)*100+1)+C2_0(1,(j-1)*100+1)+C3_0(1,(j-1)*100+1))/3;
        C0_0(2,(j-1)*100+1) = (C1_0(2,(j-1)*100+1)+C2_0(2,(j-1)*100+1)+C3_0(2,(j-1)*100+1))/3;
        C0_0(3,(j-1)*100+1) = (C1_0(3,(j-1)*100+1)+C2_0(3,(j-1)*100+1)+C3_0(3,(j-1)*100+1))/3;
        % 第三层中心点
        D0_0(1,(j-1)*100+1) = (D1_0(1,(j-1)*100+1)+D2_0(1,(j-1)*100+1)+D3_0(1,(j-1)*100+1))/3;
        D0_0(2,(j-1)*100+1) = (D1_0(2,(j-1)*100+1)+D2_0(2,(j-1)*100+1)+D3_0(2,(j-1)*100+1))/3;
        D0_0(3,(j-1)*100+1) = (D1_0(3,(j-1)*100+1)+D2_0(3,(j-1)*100+1)+D3_0(3,(j-1)*100+1))/3;
        % 第四层中心点  
        E0_0(1,(j-1)*100+1) = (E1_0(1,(j-1)*100+1)+E2_0(1,(j-1)*100+1)+E3_0(1,(j-1)*100+1))/3;
        E0_0(2,(j-1)*100+1) = (E1_0(2,(j-1)*100+1)+E2_0(2,(j-1)*100+1)+E3_0(2,(j-1)*100+1))/3;
        E0_0(3,(j-1)*100+1) = (E1_0(3,(j-1)*100+1)+E2_0(3,(j-1)*100+1)+E3_0(3,(j-1)*100+1))/3;
        % 第五层中心点
        F0_0(1,(j-1)*100+1) = (F1_0(1,(j-1)*100+1)+F2_0(1,(j-1)*100+1)+F3_0(1,(j-1)*100+1))/3;
        F0_0(2,(j-1)*100+1) = (F1_0(2,(j-1)*100+1)+F2_0(2,(j-1)*100+1)+F3_0(2,(j-1)*100+1))/3;
        F0_0(3,(j-1)*100+1) = (F1_0(3,(j-1)*100+1)+F2_0(3,(j-1)*100+1)+F3_0(3,(j-1)*100+1))/3;
        % 第六层中心点
        G0_0(1,(j-1)*100+1) = (G1_0(1,(j-1)*100+1)+G2_0(1,(j-1)*100+1)+G3_0(1,(j-1)*100+1))/3;
        G0_0(2,(j-1)*100+1) = (G1_0(2,(j-1)*100+1)+G2_0(2,(j-1)*100+1)+G3_0(2,(j-1)*100+1))/3;
        G0_0(3,(j-1)*100+1) = (G1_0(3,(j-1)*100+1)+G2_0(3,(j-1)*100+1)+G3_0(3,(j-1)*100+1))/3;

        %% 驱动杆长度与驱动角度转换雅各比

        % 方向向量为该层下一层的坐标系内
        % 第一层各驱动杆的方向向量
        limb_vector1_1 = B1_0(:,(j-1)*100+1) + P - A1_0(:,(j-1)*100+1);
        limb_vector1_2 = B2_0(:,(j-1)*100+1) + P - A2_0(:,(j-1)*100+1);
        limb_vector1_3 = B3_0(:,(j-1)*100+1) + P - A3_0(:,(j-1)*100+1);

        % 第二层的驱动杆的方向向量
        limb_vector2_1 = C1_1(:,(j-1)*100+1) + P - B1_1(:,(j-1)*100+1);
        limb_vector2_2 = C2_1(:,(j-1)*100+1) + P - B2_1(:,(j-1)*100+1);
        limb_vector2_3 = C3_1(:,(j-1)*100+1) + P - B3_1(:,(j-1)*100+1);

        % 第三层的驱动杆的方向向量
        limb_vector3_1 = D1_2(:,(j-1)*100+1) + P - C1_2(:,(j-1)*100+1);
        limb_vector3_2 = D2_2(:,(j-1)*100+1) + P - C2_2(:,(j-1)*100+1);
        limb_vector3_3 = D3_2(:,(j-1)*100+1) + P - C3_2(:,(j-1)*100+1);

        % 第四层的驱动杆的方向向量
        limb_vector4_1 = E1_3(:,(j-1)*100+1) + P - D1_3(:,(j-1)*100+1);
        limb_vector4_2 = E2_3(:,(j-1)*100+1) + P - D2_3(:,(j-1)*100+1);
        limb_vector4_3 = E3_3(:,(j-1)*100+1) + P - D3_3(:,(j-1)*100+1);

        % 第五层的驱动杆的方向向量
        limb_vector5_1 = F1_4(:,(j-1)*100+1) + P - E1_4(:,(j-1)*100+1);
        limb_vector5_2 = F2_4(:,(j-1)*100+1) + P - E2_4(:,(j-1)*100+1);
        limb_vector5_3 = F3_4(:,(j-1)*100+1) + P - E3_4(:,(j-1)*100+1);   

        % 第六层的驱动杆的方向向量
        limb_vector6_1 = G1_5(:,(j-1)*100+1) + P - F1_5(:,(j-1)*100+1);
        limb_vector6_2 = G2_5(:,(j-1)*100+1) + P - F2_5(:,(j-1)*100+1);
        limb_vector6_3 = G3_5(:,(j-1)*100+1) + P - F3_5(:,(j-1)*100+1); 


        % 第一层驱动杆单位向量
        unit_vector1_1 = limb_vector1_1/sqrt(limb_vector1_1'*limb_vector1_1);
        unit_vector1_2 = limb_vector1_2/sqrt(limb_vector1_2'*limb_vector1_2);
        unit_vector1_3 = limb_vector1_3/sqrt(limb_vector1_3'*limb_vector1_3);

        % 第二层驱动杆单位向量
        unit_vector2_1 = limb_vector2_1/sqrt(limb_vector2_1'*limb_vector2_1);
        unit_vector2_2 = limb_vector2_2/sqrt(limb_vector2_2'*limb_vector2_2);
        unit_vector2_3 = limb_vector2_3/sqrt(limb_vector2_3'*limb_vector2_3);

        % 第三层驱动杆单位向量
        unit_vector3_1 = limb_vector3_1/sqrt(limb_vector3_1'*limb_vector3_1);
        unit_vector3_2 = limb_vector3_2/sqrt(limb_vector3_2'*limb_vector3_2);
        unit_vector3_3 = limb_vector3_3/sqrt(limb_vector3_3'*limb_vector3_3);

        % 第四层驱动杆单位向量
        unit_vector4_1 = limb_vector4_1/sqrt(limb_vector4_1'*limb_vector4_1);
        unit_vector4_2 = limb_vector4_2/sqrt(limb_vector4_2'*limb_vector4_2);
        unit_vector4_3 = limb_vector4_3/sqrt(limb_vector4_3'*limb_vector4_3);
        
        % 第五层驱动杆单位向量
        unit_vector5_1 = limb_vector5_1/sqrt(limb_vector5_1'*limb_vector5_1);
        unit_vector5_2 = limb_vector5_2/sqrt(limb_vector5_2'*limb_vector5_2);
        unit_vector5_3 = limb_vector5_3/sqrt(limb_vector5_3'*limb_vector5_3);

        % 第六层驱动杆单位向量
        unit_vector6_1 = limb_vector6_1/sqrt(limb_vector6_1'*limb_vector6_1);
        unit_vector6_2 = limb_vector6_2/sqrt(limb_vector6_2'*limb_vector6_2);
        unit_vector6_3 = limb_vector6_3/sqrt(limb_vector6_3'*limb_vector6_3);


        % 第一层并联平台构型空间到驱动空间雅克比矩阵
        J_fail1 = [cross(B1_0(:,(j-1)*100+1),unit_vector1_1)';cross(B2_0(:,(j-1)*100+1),unit_vector1_2)';cross(B3_0(:,(j-1)*100+1),unit_vector1_3)'];
        % 第二层并联平台构型空间到驱动空间雅克比矩阵
        J_fail2 = [cross(C1_1(:,(j-1)*100+1),unit_vector2_1)';cross(C2_1(:,(j-1)*100+1),unit_vector2_2)';cross(C3_1(:,(j-1)*100+1),unit_vector2_3)'];
        % 第三层并联平台构型空间到驱动空间雅克比矩阵
        J_fail3 = [cross(D1_2(:,(j-1)*100+1),unit_vector3_1)';cross(D2_2(:,(j-1)*100+1),unit_vector3_2)';cross(D3_2(:,(j-1)*100+1),unit_vector3_3)'];
        % 第四层并联平台构型空间到驱动空间雅克比矩阵
        J_fail4 = [cross(E1_3(:,(j-1)*100+1),unit_vector4_1)';cross(E2_3(:,(j-1)*100+1),unit_vector4_2)';cross(E3_3(:,(j-1)*100+1),unit_vector4_3)'];
        % 第五层并联平台构型空间到驱动空间雅克比矩阵
        J_fail5 = [cross(F1_4(:,(j-1)*100+1),unit_vector5_1)';cross(F2_4(:,(j-1)*100+1),unit_vector5_2)';cross(F3_4(:,(j-1)*100+1),unit_vector5_3)'];
        % 第六层并联平台构型空间到驱动空间雅克比矩阵
        J_fail6 = [cross(G1_5(:,(j-1)*100+1),unit_vector6_1)';cross(G2_5(:,(j-1)*100+1),unit_vector6_2)';cross(G3_5(:,(j-1)*100+1),unit_vector6_3)'];
        
        %% 求驱动杆长度变化
        % 驱动长度偏差
        Delta_Length(1,:,j) = (J_fail1*[Delta_Theta(1,:,j)';0])';
        Delta_Length(2,:,j) = (J_fail2*[Delta_Theta(2,:,j)';0])';
        Delta_Length(3,:,j) = (J_fail3*[Delta_Theta(3,:,j)';0])';
        Delta_Length(4,:,j) = (J_fail4*[Delta_Theta(4,:,j)';0])';
        Delta_Length(5,:,j) = (J_fail5*[Delta_Theta(5,:,j)';0])';
        Delta_Length(6,:,j) = (J_fail6*[Delta_Theta(6,:,j)';0])';
        %% 动力学模型
        % 驱动力
        Driving_Force(:,:,j) = kp * Delta_Length(:,:,j);

            % 驱动力矩
        Driving_Torque(1,:,j) = ([-Driving_Force(1,1,j)*sqrt(3)/2*R;Driving_Force(1,1,j)*R/2]+[0;-Driving_Force(1,2,j)*R]+[Driving_Force(1,3,j)*sqrt(3)/2*R;Driving_Force(1,3,j)*R/2])';
        Driving_Torque(2,:,j) = ([-Driving_Force(2,1,j)*sqrt(3)/2*R;Driving_Force(2,1,j)*R/2]+[0;-Driving_Force(2,2,j)*R]+[Driving_Force(2,3,j)*sqrt(3)/2*R;Driving_Force(2,3,j)*R/2])';
        Driving_Torque(3,:,j) = ([-Driving_Force(3,1,j)*sqrt(3)/2*R;Driving_Force(3,1,j)*R/2]+[0;-Driving_Force(3,2,j)*R]+[Driving_Force(3,3,j)*sqrt(3)/2*R;Driving_Force(3,3,j)*R/2])';
        Driving_Torque(4,:,j) = ([-Driving_Force(4,1,j)*sqrt(3)/2*R;Driving_Force(4,1,j)*R/2]+[0;-Driving_Force(4,2,j)*R]+[Driving_Force(4,3,j)*sqrt(3)/2*R;Driving_Force(4,3,j)*R/2])';
        Driving_Torque(5,:,j) = ([-Driving_Force(5,1,j)*sqrt(3)/2*R;Driving_Force(5,1,j)*R/2]+[0;-Driving_Force(5,2,j)*R]+[Driving_Force(5,3,j)*sqrt(3)/2*R;Driving_Force(5,3,j)*R/2])';
        Driving_Torque(6,:,j) = ([-Driving_Force(6,1,j)*sqrt(3)/2*R;Driving_Force(6,1,j)*R/2]+[0;-Driving_Force(6,2,j)*R]+[Driving_Force(6,3,j)*sqrt(3)/2*R;Driving_Force(6,3,j)*R/2])';    

        for k = (j-1)*100+1:j*100
                % 计算当前时刻角加速度
                Angular_Acceleration(1,:,k) = (pinv(X_Angular_Acceleration)*(Driving_Torque(1,:,j)'-X_Omega*Omega(1,:,k)'-X_Theta*Theta(1,:,k)'))';
                Angular_Acceleration(2,:,k) = (pinv(X_Angular_Acceleration)*(Driving_Torque(2,:,j)'-X_Omega*Omega(2,:,k)'-X_Theta*Theta(2,:,k)'))';
                Angular_Acceleration(3,:,k) = (pinv(X_Angular_Acceleration)*(Driving_Torque(3,:,j)'-X_Omega*Omega(3,:,k)'-X_Theta*Theta(3,:,k)'))';
                Angular_Acceleration(4,:,k) = (pinv(X_Angular_Acceleration)*(Driving_Torque(4,:,j)'-X_Omega*Omega(4,:,k)'-X_Theta*Theta(4,:,k)'))';
                Angular_Acceleration(5,:,k) = (pinv(X_Angular_Acceleration)*(Driving_Torque(5,:,j)'-X_Omega*Omega(5,:,k)'-X_Theta*Theta(5,:,k)'))';
                Angular_Acceleration(6,:,k) = (pinv(X_Angular_Acceleration)*(Driving_Torque(6,:,j)'-X_Omega*Omega(6,:,k)'-X_Theta*Theta(6,:,k)'))';

                % 计算下一时刻角速度
                Omega(:,:,k+1)=Omega(:,:,k)+Angular_Acceleration(:,:,k) * Delta_t_3;
            
                % 计算下一时刻构型角度
